Form.create!([
  {legacy_event_id: 1, html: "<!--Demo Waiting List Form Last Updated: 2016-06-13 16:50:36. Heroku Format-->\r\n<p><strong>Demo Waiting List</strong>: Enter property damage and needs. <u>No sensitive information!</u> Tell the client this information will be shared with many organizations to provide service as fast as possible, which may be several weeks. Service is not guaranteed.</p>\r\n\r\n<div class=\"row\">\r\n        <div class=\"small-12 medium-12 large-12 columns\">\r\n            <h4>Property and Personal Information <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"<u>Crisis Cleanup is about property, not people.</u> <br /><strong>Never include SSNs, FEMA numbers, dates of birth, detailed medical information, etc.</strong>\"><i class=\"fa fa-question\"></i></span></h4>\r\n        </div>\r\n</div>\r\n<div class=\"unhide\" id=\"property_info\">\r\n<div class=\"row\">\r\n    <div class=\"input datetime-local optional legacy_legacy_site_request_date\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_request_date\">Request Date <small>(<a href=\"#\" onclick=\"document.getElementById('legacy_legacy_site_request_date').readOnly=false; document.getElementById('legacy_legacy_site_request_date').focus(); return false;\">edit</a>)</small></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"datetime-local optional\" type=\"text\" name=\"legacy_legacy_site[request_date]\" id=\"legacy_legacy_site_request_date\" readonly />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_name\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_name\">Resident Name <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"This may be the primary contact, resident, or owner.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[name]\" id=\"legacy_legacy_site_name\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_address\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_address\">Street Address</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[address]\" id=\"legacy_legacy_site_address\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_city\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_city\">City</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[city]\" id=\"legacy_legacy_site_city\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string required legacy_legacy_site_county\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_county\"><abbr title=\"required\">*</abbr> County <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"County is used for reporting purposes. Please do not edit unless you are sure it is incorrect.\"><i class=\"fa fa-question\"></i></span> <small>(<a href=\"#\" onclick=\"document.getElementById('legacy_legacy_site_county').readOnly=false; document.getElementById('legacy_legacy_site_county').focus(); return false;\">edit</a>)</small></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string required\" type=\"text\" name=\"legacy_legacy_site[county]\" id=\"legacy_legacy_site_county\" readonly />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_state\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_state\">State</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[state]\" id=\"legacy_legacy_site_state\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_zip_code\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_zip_code\">Zip Code</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[zip_code]\" id=\"legacy_legacy_site_zip_code\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input float legacy_legacy_site_latitude\">\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"float\" type=\"hidden\" name=\"legacy_legacy_site[latitude]\" id=\"legacy_legacy_site_latitude\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input float legacy_legacy_site_longitude\">\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"float\" type=\"hidden\" name=\"legacy_legacy_site[longitude]\" id=\"legacy_legacy_site_longitude\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_cross_street\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_cross_street\">Cross Street or Nearby Landmark</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[cross_street]\" id=\"legacy_legacy_site_cross_street\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string required legacy_legacy_site_phone1\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_phone1\"><abbr title=\"required\">*</abbr> Phone #s <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"At least one phone number is required. Call before helping.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string required\" type=\"text\" name=\"legacy_legacy_site[phone1]\" id=\"legacy_legacy_site_phone1\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_phone2\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_phone2\"></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[phone2]\" id=\"legacy_legacy_site_phone2\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input email optional legacy_legacy_site_email\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_email\">Email</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"email optional\" type=\"text\" name=\"legacy_legacy_site[email]\" id=\"legacy_legacy_site_email\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_time_to_call\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_time_to_call\">Best time to call</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <input class=\"string optional\" type=\"text\" name=\"legacy_legacy_site[time_to_call]\" id=\"legacy_legacy_site_time_to_call\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string required legacy_legacy_site_work_type\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_work_type\"><abbr title=\"required\">*</abbr> Primary help needed <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"Chooses the icon that appears on the map. If there is more than one type, choose the type that is most pressing.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <select class=\"small-8 medium-8 large-8 columns\" name=\"legacy_legacy_site[work_type]\" id=\"legacy_legacy_site_work_type\">\r\n                <option value=\"\">--Choose One--</option>\r\n                <option value=\"Debris\">Debris</option>\r\n                <option value=\"Food\">Feeding Unit</option>\r\n                <option value=\"Trees\">Trees</option>\r\n                <option value=\"Structure\">Structure</option>\r\n\r\n            </select>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_rent_or_own\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_rent_or_own\">Rent/ Own/ Public</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <select class=\"small-8 medium-8 large-8 columns\" name=\"legacy_legacy_site[rent_or_own]\" id=\"legacy_legacy_site_rent_or_own\">\r\n                <option value=\"\">--Choose One--</option>\r\n                <option value=\"Rent\">Rent</option>\r\n                <option value=\"Own\">Own</option>\r\n                <option value=\"Public Land\">Public Land</option>\r\n                <option value=\"Non-Profit\">Non-Profit</option>\r\n                <option value=\"Business\">Business</option>\r\n\r\n            </select>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_work_without_resident\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_work_without_resident\">Work without resident present? <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"Note: Even if this is box is checked, it may not be a good idea to work without the resident present. Follow your organization's policy on this matter.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[work_without_resident]\" id=\"legacy_legacy_site_work_without_resident_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[work_without_resident]\" id=\"legacy_legacy_site_work_without_resident\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_member_of_assessing_organization\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_member_of_assessing_organization\">Member of Your Organization</label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[member_of_assessing_organization]\" id=\"legacy_legacy_site_member_of_assessing_organization_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[member_of_assessing_organization]\" id=\"legacy_legacy_site_member_of_assessing_organization\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_first_responder\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_first_responder\">First Responder <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"First responders and their families are often the last to receive help.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[first_responder]\" id=\"legacy_legacy_site_first_responder_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[first_responder]\" id=\"legacy_legacy_site_first_responder\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_older_than_60\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_older_than_60\">Older than 60 <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"Never include dates (or years) of birth in the notes.\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[older_than_60]\" id=\"legacy_legacy_site_older_than_60_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[older_than_60]\" id=\"legacy_legacy_site_older_than_60\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_special_needs\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_special_needs\">Special needs <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"Please only include special needs that are directly related to service, e.g. 'Wheelchair-bound,' or 'Has difficulty hearing&mdash;knock hard.'\"><i class=\"fa fa-question\"></i></span></label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <textarea class=\"string optional\" name=\"legacy_legacy_site[special_needs]\" id=\"legacy_legacy_site_special_needs\"></textarea>\r\n        </div>\r\n    </div>\r\n</div>\r\n</div> <!--property_info_end-->\r\n\r\n<div class=\"row\">\r\n        <div class=\"small-12 medium-12 large-12 columns\">\r\n            <h4>Work <span data-tooltip aria-haspopup=\"true\" class=\"has-tip tip-bottom\" title=\"Contact <a href='mailto:help@crisiscleanup.org'>help@crisiscleanup.org</a> to request another question. Be sure to include the incident name.\"><i class=\"fa fa-question\"></i></span></h4>\r\n        </div>\r\n</div>\r\n<div class=\"unhide\" id=\"work_info\">\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_destruction_level\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_destruction_level\">Destruction Level</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <select class=\"small-8 medium-8 large-8 columns\" name=\"legacy_legacy_site[destruction_level]\" id=\"legacy_legacy_site_destruction_level\">\r\n                <option value=\"\">--Choose One--</option>\r\n                <option value=\"Minor\">Minor</option>\r\n                <option value=\"Moderate\">Moderate</option>\r\n                <option value=\"Major\">Major</option>\r\n                <option value=\"Extreme\">Extreme</option>\r\n                <option value=\"Destroyed\">Destroyed</option>\r\n\r\n            </select>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_work_requested\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_work_requested\">Other Work Requested</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <textarea class=\"string optional\" name=\"legacy_legacy_site[work_requested]\" id=\"legacy_legacy_site_work_requested\"></textarea>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_notes\">\r\n        <div class=\"small-4 medium-4 large-4 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_notes\">Notes</label>\r\n        </div>\r\n        <div class=\"small-8 medium-8 large-8 columns\">\r\n            <textarea class=\"string optional\" name=\"legacy_legacy_site[notes]\" id=\"legacy_legacy_site_notes\"></textarea>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n        <div class=\"small-12 medium-12 large-12 columns\">\r\n            <h5>Debris</h5>\r\n        </div>\r\n</div>\r\n<div class=\"unhide\" id=\"debris_info\">\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_interior_debris_removal\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_interior_debris_removal\">Interior Debris Removal</label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[interior_debris_removal]\" id=\"legacy_legacy_site_interior_debris_removal_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[interior_debris_removal]\" id=\"legacy_legacy_site_interior_debris_removal\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_nonvegitative_debris_removal\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_nonvegitative_debris_removal\">Non-Vegetative Debris</label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[nonvegitative_debris_removal]\" id=\"legacy_legacy_site_nonvegitative_debris_removal_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[nonvegitative_debris_removal]\" id=\"legacy_legacy_site_nonvegitative_debris_removal\" value=\"y\" />\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"input string optional legacy_legacy_site_vegitative_debris_removal\">\r\n        <div class=\"small-11 medium-11 large-11 columns\">\r\n            <label class=\"\" for=\"legacy_legacy_site_vegitative_debris_removal\">Vegetative Debris</label>\r\n        </div>\r\n        <div class=\"small-1 medium-1 large-1 columns\">\r\n            <input class=\"string optional\" type=\"hidden\" name=\"legacy_legacy_site[vegitative_debris_removal]\" id=\"legacy_legacy_site_vegitative_debris_removal_h\" value=\"n\" />\r\n            <input class=\"string optional\" type=\"checkbox\" name=\"legacy_legacy_site[vegitati